import React from "react";
import { Switch, Route, Redirect } from "react-router-dom";

import Index from "../pages/Main/Index";
import MainBottomTab from "../components/layout/MainBottomTab";

const MainRoute = ({ match, location, history }) => {
  const navigate = (pathname) => {
    history.push(pathname);
  };
  return (
    <>
      <Switch>
        {/** 홈 */}
        <Route exact path={`${match.url}/index`} component={Index} />
        {/** 마이메뉴 */}

        <Redirect from={`*`} to={`${match.url}/index`} />
      </Switch>
      <MainBottomTab pathname={location.pathname} onClick={navigate} />
    </>
  );
};

export default MainRoute;
